import React from 'react';

const Card = (props) => {
    return (
    <div className="card">
        <h5 className="card-header">{props.name}</h5>
        <div className="card-body">
            <h5 className="card-title">$3000</h5>
            <p className="small pt-0 mt-0">hello world</p>
            <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
            <button className="btn btn-info"><i class="fas fa-sync-alt pr-2"></i>Refresh</button>
        </div>
    </div>
    );
};

export default Card;
